import React from 'react'

class LaCarta extends React.Component{
    render (){
        return (
            <div id='lacarta' className='bg-blue-dark pb-5 pt-5'>
                <div className='container'>
                    <p className='fs-28 text-align-center mb-0'>La Carta</p>
                    <br/>
                    <p className='fs-16 text-align-center'>Consulta nuestra gran variedad de platos que tenemos para ti.</p>
                </div>
            </div>
        )
    }
}

export default LaCarta
